// Get webhook data from Workflow Configuration node (which passes through webhook data)
const webhookData = $('Workflow Configuration').first().json;

// Check if webhook body exists (workflow triggered by webhook, not manual trigger)
if (!webhookData.body) {
  // No webhook data - return empty array to stop execution gracefully
  return [];
}

// Get reference sheet data from 'Get Projects from Справочники' node
const referenceData = $('Get Projects from Справочники').all();

// Create a map of project names to timesheet IDs from reference data
// Column 'Проекты' maps to 'Табель' column
const projectToTimesheetMap = {};
for (const item of referenceData) {
  const projectName = item.json['Проекты'];
  const timesheetId = item.json['Табель'];
  if (projectName && timesheetId) {
    projectToTimesheetMap[projectName] = timesheetId;
  }
}

// Extract worker data from body
const clientId = webhookData.body.client_id;
const fullName = webhookData.body.full_name;
const phone = webhookData.body.phone;
const labels = webhookData.body.labels || {};

// Выбираем ОДНУ метку: ту, у которой максимальный numeric-ключ среди тех,
// для кого найден timesheetId в справочнике.
let bestChoice = null;

for (const labelKey of Object.keys(labels)) {
  const labelValue = labels[labelKey];

  // Extract project name from label (format: '1: ProjectName')
  const match = labelValue.match(/^\d+:\s*(.+)$/);
  const projectName = match ? match[1].trim() : labelValue.trim();

  // Find matching timesheet ID from reference sheet
  const timesheetId = projectToTimesheetMap[projectName];
  if (!timesheetId) {
    console.log(`Warning: No timesheet ID found for project: ${projectName}`);
    continue;
  }

  const numericKey = Number(labelKey);
  if (!Number.isFinite(numericKey)) {
    continue;
  }

  if (!bestChoice || numericKey > bestChoice.numericKey) {
    bestChoice = {
      numericKey,
      projectName,
      timesheetId,
    };
  }
}

// Если ни одной подходящей метки с timesheetId не найдено — дальше обрабатывать нечего
if (!bestChoice) {
  return [];
}

// Возвращаем ровно ОДИН item
return [
  {
    json: {
      client_id: clientId,
      full_name: fullName,
      phone: phone,
      labels: Object.values(labels),
      projectName: bestChoice.projectName,
      timesheetId: bestChoice.timesheetId,
    },
  },
];

// Get current date
const now = new Date();
const month = now.getMonth(); // 0-11

// Get month sheet names from Workflow Configuration
const config = $('Workflow Configuration').first().json;

// monthSheetNames уже объект, парсить не нужно
const monthSheetNames = config.monthSheetNames;

// Get the current month sheet name
const currentMonthSheet = monthSheetNames[month.toString()];

// Pass through all data from previous node
const inputData = $input.item.json;

// Return all data plus currentMonthSheet field
return {
  json: {
    ...inputData,
    currentMonthSheet,
  },
};

// Читаем конфиг и payload
const config = $('Workflow Configuration').first().json;
const payload = config.body || {};

// Если по какой-то причине body нет — завершаем
if (!Object.keys(payload).length) {
  return [{
    json: {
      action: 'error',
      message: 'Webhook body is empty in Workflow Configuration',
    },
  }];
}

// Входящие строки табеля из предыдущей ноды (Read Timesheet)
const sheetRows = $input.all().map(item => item.json);

// Достаём timesheetId и currentMonthSheet из ноды Process Each Timesheet
const upstream = $('Process Each Timesheet').first().json || {};
const timesheetId = upstream.timesheetId;
const currentMonthSheet = upstream.currentMonthSheet;

// Извлекаем данные исполнителя БЕЗ дефолтов
const fullName = (payload.full_name ?? '').toString().trim();
const phone = (payload.phone ?? '').toString().trim();
const clientId = (payload.client_id ?? '').toString().trim();

// labels приходят объектом: { id: "N: Тег", ... }
let labelsStr = '';
if (payload.labels && typeof payload.labels === 'object') {
  const values = Object.values(payload.labels)
    .map(v => v?.toString().trim())
    .filter(Boolean);
  labelsStr = values.join(', ');
} else if (typeof payload.labels === 'string') {
  labelsStr = payload.labels.trim();
}

// Названия колонок и параметры блока берём из Workflow Configuration
const fioColumn = config.workerFioColumnName;
const clientColumn = config.workerClientColumnName;
const phoneColumn = config.workerPhoneColumnName;
const tagsColumn = config.workerTagsColumnName;
const BLOCK_SIZE = Number(config.workerBlockSize);
const firstDataRow = Number(config.workerFirstDataRow);

let action = '';
let rowNumber = null;
let message = '';

// Без client_id нет смысла продолжать
if (!clientId) {
  action = 'error';
  message = 'client_id is empty';
} else {
  // 1) Проверяем, есть ли такой исполнитель уже в табеле (по client_id / comments)
  const byClient = new Map();
  for (const row of sheetRows) {
    const cid = (row[clientColumn] || '').toString().trim();
    if (cid) {
      byClient.set(cid, row);
    }
  }

  const existing = byClient.get(clientId);

  if (existing && typeof existing.row_number !== 'undefined') {
    // Исполнитель уже есть — обновляем первую строку его блока (row_number)
    action = 'update';
    rowNumber = Number(existing.row_number);
    message = 'Исполнитель найден по client_id, обновляем строку ' + rowNumber;
  } else {
    // 2) Ищем свободный блок из двух строк
    const dataRows = sheetRows
      .filter(r => typeof r.row_number !== 'undefined')
      .sort((a, b) => Number(a.row_number) - Number(b.row_number));

    let foundStart = null;

    for (const row of dataRows) {
      const rn = Number(row.row_number);
      if (!Number.isFinite(rn) || rn < firstDataRow) continue;

      // Верхняя строка блока: смещение от firstDataRow кратно BLOCK_SIZE
      const indexInBlock = (rn - firstDataRow) % BLOCK_SIZE;
      if (indexInBlock !== 0) continue;

      const row2 = dataRows.find(r => Number(r.row_number) === rn + 1);
      if (!row2) continue;

      const fio1 = (row[fioColumn] || '').toString().trim();
      const fio2 = (row2[fioColumn] || '').toString().trim();

      // Условие свободного места: обе строки блока без ФИО
      if (!fio1 && !fio2) {
        foundStart = rn;
        break;
      }
    }

    if (foundStart) {
      action = 'insert';
      rowNumber = foundStart;
      message = 'Свободное место найдено, используем блок c первой строкой ' + rowNumber;
    } else {
      action = 'skip';
      message = 'Свободное место (2 строки подряд без ФИО) не найдено, вставка пропущена';
    }
  }
}

const result = {
  action,
  message,
  input: {
    client_id: clientId,
    full_name: fullName,
    phone,
    labels: labelsStr,
  },
  timesheetId,
  currentMonthSheet,
};

// ВАЖНО: rowNumber наружу всегда как строка, чтобы If-нода / Switch не ругались
if (rowNumber) {
  result.rowNumber = rowNumber.toString();
  result[fioColumn] = fullName;
  result[phoneColumn] = phone;
  result[clientColumn] = clientId;
  result[tagsColumn] = labelsStr;
}

return [{ json: result }];
